import React from "react";
import "./App.css";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/questions")
      .then((res) => res.json())
      .then((data) => setData(data))});

const displayQuestions = [];
displayQuestions[1] = `${data[0].question}`

return (
  <div>
    <li>{displayQuestions[1]}</li>
  </div>
);
}

export default App;
